import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import App from './App';
import reportWebVitals from './reportWebVitals';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap-icons/font/bootstrap-icons.css";
import { CookiesProvider } from 'react-cookie';
import ShopperIndex from "./Components/Shopper-Index/shoper-index.js";
// import MaterialUIComponent from "./Components/MaterialUIComponents/materialUiComponent.js"
// import EffectComponent from './Components/Hooks/Effects-Component/effectComponent';
// import EffectComponent2 from './Components/Hooks/Effects-Component/effectComponent2';
// import ContextDemo from './Components/Hooks/Context-Component/contextDemo';
// import ReducerDemoComponent from './Components/Hooks/Reducer-Component/reducerComponent';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <CookiesProvider>
      {/* <ReducerDemoComponent /> */}
      {/* <ContextDemo /> */}
      {/* <EffectComponent2 /> */}
      {/* <EffectComponent /> */}
      {/* <MaterialUIComponent /> */}
      <ShopperIndex />
      {/* <App /> */}
    </CookiesProvider>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
